// ==UserScript==
// @name           JAV preview screenshot
// @namespace      https://sleazyfork.org/en/users/191134
// @author         Hobby, b1vo15o0.nyn
// @description    Show video preview screenshot on AVMOO, AVSOX and JavBus
// @version        0.2
// @include        *://*javbus.com/*
// @include        *://*javbus.me/*
// @include        *://*javbus.info/*
// @include        *://*javlog.com/*
// @include        *://*avmoo.com/*
// @include        *://*javfee.com/*
// @include        *://*avsox.com/*
// @run-at         document-end
// @grant          GM_xmlhttpRequest
// @grant          GM_addStyle
// @require        https://code.jquery.com/jquery-3.3.1.slim.min.js
// @connect        blogjav.net
// @connect        pixhost.to
// @icon           data:image/jpeg;base64,
// @downloadURL https://update.greasyfork.org/scripts/369639/JAV%20preview%20screenshot.user.js
// @updateURL https://update.greasyfork.org/scripts/369639/JAV%20preview%20screenshot.meta.js
// ==/UserScript==

(function() {
 let Common = {
  parsetext: function(text) {
   var doc = null;
   try {
    doc = document.implementation.createHTMLDocument('');
    doc.documentElement.innerHTML = text;
    return doc;
   } catch (e) {
    alert('parse error');
   }
  },

  addAvImg: function(avid, func) {
   GM_xmlhttpRequest({
    method: "GET",
    url: 'http://blogjav.net/?s=' + avid,
    onload: function(result) {
     var doc = Common.parsetext(result.responseText);
     let a_array = $(doc).find(".more-link");
     let a = a_array[0];
     for (let i = 0; i < a_array.length; i++) {
      var fhd_idx = a_array[i].innerHTML.search(/FHD/);
      if (fhd_idx > 0) {
       a = a_array[i];
       break;
      }
     }

     if (a) {
      GM_xmlhttpRequest({
       method: "GET",
       url: a.href,
       headers: {
        referrer: "http://pixhost.to/"
       },
       onload: function(XMLHttpRequest) {
        var bodyStr = XMLHttpRequest.responseText;
        var yixieBody = bodyStr.substring(bodyStr.search(/<span id="more-(\S*)"><\/span>/), bodyStr.search(/<div class="category/));

        var img_start_idx = yixieBody.search(/"><img .*src="https*:\/\/(\S*)pixhost.to\/thumbs\//);
        if (img_start_idx > 0) {
         var new_img_src = yixieBody.substring(yixieBody.indexOf('src', img_start_idx) + 5, yixieBody.indexOf('alt') - 2);
         var targetImgUrl = new_img_src.replace('thumbs', 'images').replace('//t', '//img').replace(/[\?*\"*]/, '').replace('https', 'http');

         var $img = $('<img id="screenshot" title="Click to enlarge"></img>');
         $img.attr("src", targetImgUrl);
         $img.attr("style", "float: left;cursor: pointer;");

         func($img);
        }
       },
       onerror: function(e) {
        console.log(e);
       }
      });
     }
    },
    onerror: function(e) {
     console.log(e);
    }
   });
  },
 };

 function mainRun() {

  GM_addStyle([
   'img#screenshot{width:66px;min-height:233px;height:auto;cursor:pointer;padding-left:15px;}',
   '.full{width:100%!important;padding:15px 15px 0px 15px;}',
  ].join(''));

  var AVID = "";
  if ((/(JavBus|AVMOO|AVSOX)/g).test(document.title) && $('.header').length) {
   let AVID = $('.header')[0].nextElementSibling.textContent;

   window.onload = function() {
    $('iframe').remove();
   };

   Common.addAvImg(AVID, function($img) {
    var divEle = $("div[class='col-md-3 info']")[0];
    $(divEle).attr("id", "video_info");
    if (divEle) {
     $(divEle.parentElement).append($img);
     $img.click(function() {
      $(this).toggleClass('full');
      if ($(this).attr("class")) {
       this.parentElement.parentElement.scrollIntoView();
      }
     });
    }
   });

  }

 }

 mainRun();
})();